import React, { useState } from 'react';

function SimpleMenuExample() {
  const [selectedMenu, setSelectedMenu] = useState(0);
  const [isProfileOpen, setIsProfileOpen] = useState(false);

  const menuItems = ['Dashboard', 'Orders', 'Holdings', 'Positions', 'Funds', 'Apps'];

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial' }}>
      <h2>Simple Menu Example</h2>

      <ul style={{ listStyleType: 'none', padding: 0 }}>
        {menuItems.map((item, index) => (
          <li
            key={index}
            onClick={() => setSelectedMenu(index)}
            style={{
              marginBottom: '10px',
              padding: '10px',
              cursor: 'pointer',
              backgroundColor: selectedMenu === index ? '#007bff' : '#eee',
              color: selectedMenu === index ? '#fff' : '#000',
              borderRadius: '5px',
              width: '150px'
            }}
          >
            {item}
          </li>
        ))}
      </ul>

      <hr />

      <div onClick={() => setIsProfileOpen(!isProfileOpen)} style={{ cursor: 'pointer' }}>
        <div
          style={{
            backgroundColor: '#ccc',
            width: '50px',
            height: '50px',
            borderRadius: '50%',
            textAlign: 'center',
            lineHeight: '50px',
            marginBottom: '10px'
          }}
        >
          ZU
        </div>
        <p>USERID</p>
      </div>

      {isProfileOpen && (
        <div
          style={{
            marginTop: '10px',
            padding: '10px',
            border: '1px solid #ddd',
            width: '200px',
            backgroundColor: '#f9f9f9'
          }}
        >
          <p>ðŸ‘¤ Profile dropdown is open</p>
        </div>
      )}
    </div>
  );
}

export default SimpleMenuExample;
